import { configure } from '@storybook/react';
module._StorybookPreserveDecorators = true;

configure([require.context('../src/components', true, /^\.\/(?:(?:|\/|(?:(?:(?!(?:|\/)\.).)*?)\/)(?!\.)(?=.)[^/]*?\.stories\.(tsx|mdx))$/)
], module);
